import React from 'react';
import { Expense } from '../types'; // Importing the Expense interface
import ExpenseForm from './ExpenseForm';

interface ExpenseProps {
  expenses: Expense[];
  setExpenses: React.Dispatch<React.SetStateAction<Expense[]>>;
  categories: string[];
}

const Expenses: React.FC<ExpenseProps> = ({ expenses, setExpenses, categories }) => {
  return (
    <div>
      <h2>Expenses</h2>
      <ExpenseForm setExpenses={setExpenses} categories={categories} />
      {/* Display expenses here */}
    </div>
  );
};

export default Expenses;
